import { BrowserRouter as Router, Route, Link, NavLink, Switch } from "react-router-dom";

import mainMenu from "./Pages/mainMenu";
import toDoList from "./Pages/Apps/toDoList";

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="./Pages/manuMenu" component={mainMenu} />
        <Route exact path="./Pages/Apps/toDoList" component={toDoList} />
      </Switch>
    </Router>
  );
}

export default App;
